ist">\r\n<li><strong>1 </strong> Domains Limit <a class="boxtip" href="#" rel="tooltip" data-original-title="Number of domains supported: you are entitled to install our products. The membership you purchase specifies the total number of domains supported.">(?) </a></li>\r\n<li><strong>Access to All Templates <a class="boxtip" href="#" rel="tooltip" data-original-title="You can download and use any available templates.">(?) </a> </strong></li>\r\n<li><strong>Access to All Extensions <strong><a class="boxtip" href="#" rel="tooltip" data-original-title="You can download extensions included in templates only. All Extensions of SmartAddons can be downloaded with Developer Membership">(?) </a></strong> </strong></li>\r\n<li>No Discount <a class="boxtip" href="#" rel="tooltip" data-original-title="In case you require to renew your membership after it has expired you can benefit from the discount options that we offer.">(?) </a></li>\r\n<li>Support Forum / Ticket</li>\r\n</ul>\r\n<p>[/plan] [plan title="JEC Business" button_link="http://www.smartaddons.com/index.php?option=com_osemsc&amp;view=register&amp;Itemid=292&amp;step=step2&amp;layout=twocolumns&amp;msc_id=2" button_label="Join Now" price="$79" featured="false" per="6 month"]</p>\r\n<ul class="pricing-list">\r\n<li><strong>5 </strong> Domains Limit <a class="boxtip" href="#" rel="tooltip" data-original-title="Number of domains supported: you are entitled to install our products. The membership you purchase specifies the total number of domains supported.">(?) </a></li>\r\n<li><strong>Access to All Templates <a class="boxtip" href="#" rel="tooltip" data-original-title="You can download and use any available templates.">(?) </a> </strong></li>\r\n<li><strong>Access to All Extensions <strong><a class="boxtip" href="#" rel="tooltip" data-original-title="You can download extensions included in templates only. All Extensions of SmartAddons can be downloaded with Developer Membership">(?) </a></strong> </strong></li>\r\n<li>No Discount 10% <a class="boxtip" href="#" rel="tooltip" data-original-title="In case you require to renew your membership after it has expired you can benefit from the discount options that we offer.">(?) </a></li>\r\n<li>Support Forum / Ticket</li>\r\n</ul>\r\n<p>[/plan] [plan title="JEC Developer" button_link="http://www.smartaddons.com/index.php?option=com_osemsc&amp;view=register&amp;Itemid=292&amp;step=step2&amp;layout=twocolumns&amp;msc_id=3" button_label="Join Now" price="$99" featured="false" per="1 Year"]</p>\r\n<ul class="pricing-list">\r\n<li>Domains Unlimited <a class="boxtip" href="#" rel="tooltip" data-original-title="Number of domains supported: you are entitled to install our products. The membership you purchase specifies the total number of domains supported.">(?) </a></li>\r\n<li><strong>Access to All Templates <a class="boxtip" href="#" rel="tooltip" data-original-title="You can download and use any available templates.">(?) </a> </strong></li>\r\n<li><strong>Access to All Extensions <strong><a class="boxtip" href="#" rel="tooltip" data-original-title="You can download extensions included in templates only. All Extensions of SmartAddons can be downloaded with Developer Membership">(?) </a></strong> </strong></li>\r\n<li>No Discount 30% <a class="boxtip" href="#" rel="tooltip" data-original-title="In case you require to renew your membership after it has expired you can benefit from the discount options that we offer.">(?) </a></li>\r\n<li>Support Forum / Ticket</li>\r\n</ul>\r\n<p>[/plan] [/pricing] [/tab_item] [/tabs]</p>\r\n<p>[space height="20"]</p>\r\n<h2 class="fontsize_l">Frequently Asked Questions</h2>\r\n<p>Frequently asked questions for our Joomla! Templates Club memberships.</p>\r\n<p>[accordion] [acc_item title="What will I get after I join a membership plan?"]</p>\r\n<p><strong>1. Template Membership</strong>: After you join the club, you will immediately access the download area of the templates. There you should find your favorite template and download it. You will see two parts for each download: The Source Files and The All In One Package. The All In One Package contains all the files that are necessary to install the template on the site: the Template file, the Cloner Installer to make your site exactly like the demo, all the modules, components and plug-ins included in that template and of course the documentation guide. The Source Files package contains the Adobe Photoshop files so that you can easily edit the design part of the template.</p>\r\n<p><strong>2. Extension Membership</strong>: After you join the club, you will immediately access the download area of the extensions. There you should find your favorite extension and download it.</p>\r\n<p>[/acc_item] [acc_item title="What payment methods do you accept?"] We accept PayPal payments, credit cards (major credit cards like Visa, MasterCard, Maestro, American express etc.). The payments are managed by 2CheckOut, one of the most powerful payment gateway systems. They are completely secure as you are the only one who has access to your financial information. You may also pay through bank transfer. Please, contact us for further details regarding the payment methods. [/acc_item] [acc_item title="What will happen after my membership expires?"] After your membership expires you may continue using the same template/extension you have downloaded and installed on your domain. In fact, you may use the same template/extension for lifetime if you wish. No other payment is required to keep the same template/extension. The payment is a one-time fee. However, you won''t be able to have support from SmartAddons after the expiry. Support is given as long as you are an active member. [/acc_item] [acc_item title="Membership fees are refundable?"] Yes, we have a money back program that refunds completely your payment, if it is asked for it up to 7 days after your subscription day. Although it is a money back program, we will need a valid reason to refund your payment. We can''t accept motives like "I didn''t notice this product was for Joomla" or "I didn''t realize this template doesn''t work with Joomla 1.5". Of course, we take our responsibility for any possible problem with our products and will refund your money if we haven''t delivered you the promised product. [/acc_item] [acc_item title="How many templates/extensions am I allowed to download/use? "] The number of the templates/extensions that you may use depends on the membership plan that you have joined. You are free to download as many templates/extensions as you consider appropriate in order to test and check them out, regardless the plan that you chose. However, you may not take advantage of every template/extensions that you have downloaded. The membership plan limits you to a specific number of domains in which you can install the templates/extensions. For Personal Membership this is two, meaning that you can use two domains. For Business Membership and Developer Membership the number is Unlimited, meaning that there is no limit in the number of domains to be created. [/acc_item] [acc_item title="Can I use the templates/extensions for non commercial and nonprofit sites? "] You may use the templates/extensions for commercial and non commercial purpose. You may use it to create your company''s or personal website. If you are a designer or a freelancer, you can use them for your clients. Our templates/extensions have been also used from non profits organizations and institutions, as well as churches. However, you may not use our templates/extensions to create sites which convey to inappropriate content like crime, violence, threatening etc. [/acc_item] [/accordion]</p>\r\n<p> </p>\r\n<p> </p>\r\n<p> </p>\r\n</div>', '', 1, 91, '2013-02-25 08:30:29', 124, '', '2014-03-24 02:41:48', 660, 0, '0000-00-00 00:00:00', '2013-02-25 08:30:29', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fullt