(179, 302, 'Shortcodes', 'short-codes', '<div style="text-align: center;"><a href="http://www.smartaddons.com/joomla/extensions/commercial-extensions/item/564-yt-shortcode-joomla-plugin" target="_blank"><img src="images/shortcode/shortcode.jpg" alt="YT Shortcode" /> </a></div>\r\n<p>[space height="20"]</p>\r\n<div style="text-align: center;">\r\n<p>[button type="flat inverse" target="_blank" link="http://demo.smartaddons.com/extensions/yt-shortcode/index.php"] View all example YT Shortcode [/button]</p>\r\n</div>\r\n<p>The shortcodes supports users to make content for web pages. In Joomla administrator, Yt Shortcodes button will be appeared below the text-area, you can choose shortcodes for the text-area to make content. We will show <strong>bonus pages</strong> for sample in some templates using shortcodes from now.</p>\r\n<p class="text-error"><strong>Note:</strong> Shortcodes only works in <strong>detail</strong> article (joomla! content, k2 content), custom html module.</p>\r\n<p><strong>YT Shortcode User-guide:</strong></p>\r\n<p>Let''s go to <a style="color: #0291ff;" href="http://smartaddons.s3.amazonaws.com/images/userguide/Yt-Shortcodes/index.html" target="blank">here</a> for reading full help documentation of YT Shortcode Plugin</p>', '', 1, 9, '2013-03-07 07:14:55', 124, '', '2014-04-01 10:18:43', 660, 86, '2014-04-02 08:33:53', '2013-03-07 07:14:55', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_it