(183, 306, 'What''s new?', 'what-s-new', '<div id="g-pagewhatnew">\r\n<p>[message_box title="New UI for backend template" type="info" show_close="Yes"]From the YT Framework v2, we support UI for backend of template. We hope this will bring to you the best gratification.[/message_box]</p>\r\n<p>[message_box title="Renew, add new params" type="info" show_close="Yes"] With this version, you will get many renewing, many new added params.[/message_box]</p>\r\n<p>[message_box title="Support shortcodes, bonus pages" type="info" show_close="Yes"]From the YT Framework v2, we will support shortcodes and bonus pages. Let <a href="index.php?option=com_content&amp;view=article&amp;id=179&amp;Itemid=648">click here </a>for more info. [/message_box]</p>\r\n<h3 class="title">YT v2 screenshot</h3>\r\n[columns background="none"] [column_item col="4"]\r\n<div class="yt-lightbox curved  image-none  "><a href="images/yt/overview-desc.jpg" title="Template info &amp; desc" data-rel="prettyPhoto"><img src="images/yt/screenshot1.png" border="0" /></a></div>\r\n<h5 class="align-center">Template info &amp; desc</h5>\r\n[/column_item] [column_item col="4"]\r\n<div class="yt-lightbox curved  image-none  "><a href="images/yt/overview-version.jpg" title="Template version &amp; Framework version" data-rel="prettyPhoto"><img src="images/yt/screenshot2.png" border="0" /></a></div>\r\n<h5 class="align-center">Template version &amp; Framework version</h5>\r\n[/column_item] [column_item col="4"]\r\n<div class="yt-lightbox curved  image-none  "><a href="images/yt/layout-setting.jpg" title="Layout setting" data-rel="prettyPhoto"><img src="images/yt/screenshot3.png" border="0" /></a></div>\r\n<h5 class="align-center">Layout setting</h5>\r\n[/column_item] [/columns] [columns background="none"] [column_item col="4"]\r\n<div class="yt-lightbox curved  image-none  "><a href="images/yt/menu-setting.jpg" title="Menu setting" data-rel="prettyPhoto"><img src="images/yt/screenshot4.png" border="0" /></a></div>\r\n