(199, 0, 'For customize module in special position', '', '<p>The solution is using Module Class Suffix. You can customize button, module content follow Module Class Suffix</p>\r\n<p>E.g. Module Class Suffix: <strong>bg-white</strong> @<strong>bullhorn</strong> then:<br />- Class of buttom is ''ico-<strong>bullhorn</strong>''<strong>. </strong>If without @<strong>... </strong>the default is ''icon-pushpin''<br /><strong>- </strong>Class of module is ''<strong>bg-white</strong>''</p>', 1, 'sticky_right', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":" bg-white @info-sign","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
